import { setState, getState } from './store.js';
import { Api } from './api.js';
import { ReportsList } from './components/ReportsList.js';
import { ReportEditor } from './components/ReportEditor.js';
import { CitizenProfile } from './components/CitizenProfile.js';
import { VehicleProfile } from './components/VehicleProfile.js';
import { WeaponProfile } from './components/WeaponProfile.js';
import { CaseLinker } from './components/CaseLinker.js';
import { TemplateManager } from './components/TemplateManager.js';
import { SearchPanel } from './components/SearchPanel.js';
import { AdminPanel } from './components/AdminPanel.js';
import { AuditLog } from './components/AuditLog.js';
import { calculateReportTotals } from './utils/calculator.js';
import { uuidv4 } from './utils/uuid.js';
const app=document.getElementById('app');
const sidebar=document.createElement('div'); sidebar.className='sidebar';
const content=document.createElement('div'); content.className='content';
app.append(sidebar,content);
const sections=['reports','citizens','vehicles','weapons','employees','linked','templates','settings','audit'];
sidebar.innerHTML=sections.map(s=>`<button class='btn' data-s='${s}' style='display:block;margin-bottom:6px;width:100%'>${s}</button>`).join('');
const comps={reports:new ReportsList(content),citizens:new CitizenProfile(content),vehicles:new VehicleProfile(content),weapons:new WeaponProfile(content),linked:new CaseLinker(content),templates:new TemplateManager(content),audit:new AuditLog(content),employees:new SearchPanel(content),settings:new AdminPanel(content)};
function mountSection(name){ if(comps[name]) comps[name].render(); else content.innerHTML=`<div class='card'><h2>${name}</h2></div>`; }
sidebar.addEventListener('click',e=>{const b=e.target.closest('[data-s]'); if(!b)return; setState({section:b.dataset.s}); mountSection(b.dataset.s);});
window.addEventListener('message',(ev)=>{const d=ev.data||{}; if(d.action==='open'){app.style.display='flex'; setState({activeOfficer:d.officer}); mountSection('reports');} if(d.action==='close'){app.style.display='none';}});
async function saveDraft(){const s=getState(); if(!s.activeReport){s.activeReport={id:uuidv4(),title:'Nouveau rapport',charges:[]};} const totals=calculateReportTotals(s.activeReport.charges||[],{numPriors:s.activeReport.numPriors||0,recidiveCodes:new Set(s.activeReport.recidiveCodes||[]),comboRules:s.comboRules||[]}); s.activeReport.totals=totals; await Api.saveReport(s.activeReport);}
window.b2bMDT={saveDraft};
